import React from "react";
import "./CustomButton.scss";

const CustomButton = ({ children, inverted, ...otherProps }) => {
  return (
    <div>
      <button className={`${inverted} ? 'inverted' : '' Custom`}>
        {children}
      </button>
    </div>
  );
};

export default CustomButton;
